import React from 'react';
import classes from './FooterList.module.css';

const Footer = (props) => (
  <>
    <li className={classes.List}>
      <span
        style={{
          backgroundImage: `url("${props.icon}")`,
        }}
      >
        <a className={classes.Anchor} href={props.redirect}></a>
      </span>
    </li>
  </>
);

export default Footer;
